"""
    basic plan:
        1. Shuffle the array -- 可用random.shuffle, 就地打乱,random.shuffle 
           函数不关心参数的类型,只要那个对象实现了部分可变序列协议即可
        2. partition 函数返回j

        3. sort
"""

def quick_sort(nums, lo, hi): 
    if lo >= hi:
        return 
    j = partition(nums, lo, hi)
    quick_sort(nums, lo, j-1)
    quick_sort(nums, j+1, hi)
    return 

# 之前一直觉得这种写法不优雅, 要考虑Corner case, 其实现在想来, 考虑一种就好, 当只有两个数字时, 排好序和未拍好序的情况, 返回的j是pivot 应该在的位置
def partition(nums, lo: int, hi: int):
    i = lo+1
    j = hi
    # n = 20
    while True:
    # while i < j:
        while  nums[i] < nums[lo]:
            if i == hi:
                break
            i += 1

        while nums[j] > nums[lo]:
            if j == lo:
                break
            j -= 1
        if i >= j:
            break
        nums[i], nums[j] = nums[j], nums[i]
        # 此两步非常重要在于, 如果此时i和j同时指向相同的数字, 程序将陷入死循环
        i += 1
        j -= 1
    nums[lo], nums[j] = nums[j], nums[lo]

    return j

