def partition2(array, lo, hi):
    pivot = array[lo]
    i = lo + 1
    j = hi

    while i <= j:
        # print(i)
        # print(j)
        # print("=="*20)
        while array[i] < pivot:
            if i == hi:
                break
            i += 1

        while array[j] > pivot:
            if j == lo:
                break
            j -= 1

        array[i], array[j] = array[j], array[i]
        i += 1
        j -= 1


    array[lo], array[j] = array[j], array[lo]
    return j
