# 算法导论有相关的讨论, 但是都在思考题部分, 反而是上面参考普林斯顿的写法, 效率很高
def qsort3(array, start, last):
    if last > start:
        q = rand_partition3(array, start, last)
        qsort3(array, start, q-1)
        qsort3(array, q+1, last)

    return

def rand_partition3(array, start, last):
    i = randint(start, last)
    array[i], array[last] = array[last], array[i]
    return partition3(array, start, last)

def partition3(array, start, last):
    i = start - 1
    pivot = array[last]
    for j in range(start, last):
        if array[j] <= pivot:
            i += 1
            array[i], array[j] = array[j], array[i]
    array[i+1], array[last] = array[last], array[i+1]
    return i+1




